import React from "react";
import ReactDOM from 'react-dom';




const TodoList = () => {
  const items = ['Install React', 'Study React', 'Use React', 'Build React App'];
  return (
    <ul>
      <li>{items[0]}</li>
      <li>{items[1]}</li>
      <li>{items[2]}</li>
      <li>{items[3]}</li>
    </ul>
  );
};





const SearchPanel = () => {
 const searchText = 'Type here to search';
 const searchStyle = {
  fontSize: '20px'
 };


return <input
      style = {searchStyle}
      placeholder= {searchText}
      disabled={true} />;

}

const App = () => {
  return (
    <div>
      <AppHeader/>
      <SearchPanel/>
      <TodoList/>
    </div>
  );
}



ReactDOM.render(<App/>,
  document.getElementById('root'));
